// @flow strict

const Navigation = ({ props }: Props) => {
	return (
		<React.Fragment>
			{!!props.next && <button onClick={() => setQuery(props.next)}>Next</button>}
			{!!props.previous && <button onClick={() => setQuery(props.previous)}>Previous</button>}
		</React.Fragment>
	)
}

export { Navigation };
